  getLogin,
  postLogin,
  kakaoLogin,
  postKakaoLogin,
  googleLogin,
  postGoogleLogin,
  getMe,
  naverLogin,
  postNaverLogin,
} from "../controllers/userController";
import { home, search } from "../controllers/photoController";
