import routes from "../routes";
import Photo from "../models/Photo";
import Comment from "../models/Comment";

export const home = async (req, res) => {
  const { user } = req;
  try {
    const photos = await Photo.find({})
      .sort({ _id: -1 })
      .populate("creator")
      .populate("comments");
    res.render("home", {
      pageTitle: "Home",
      photos,
      user,
    });
  } catch (error) {
    console.log(error);
    res.render("home", { pageTitle: "Home", photos: [], user });
  }
};

export const search = async (req, res) => {
  const {
    user,
    query: { term: searchingBy },
  } = req;
  try {
    const photos = await Photo.find({
      description: { $regex: searchingBy, $options: "i" },
    })
      .sort({ _id: -1 })
      .populate("comments")
      .populate("creator");
    res.render("search", {
      pageTitle: "Search",
      searchingBy,
      photos,
      user,
    });
  } catch (error) {
    console.log(error);
    res.render("home", { pageTitle: "Home", photos: [], user });
  }
};
export const getUpload = (req, res) => {
  res.render("upload", {
    pageTitle: "Upload Photo",
  });
};
export const postUpload = async (req, res) => {
  const {
    body: { description },
    files,
  } = req;
  const fileUrl = files.map((file) => file.path);
  try {
    const newPhoto = await Photo.create({
      fileUrl,
      description,
      creator: req.user.id,
    });
    req.user.photos.push(newPhoto.id);
    req.user.save();
    res.redirect(routes.photoDetail(newPhoto.id));
  } catch (error) {
    console.log(error);
    res.redirect(routes.upload);
  }
};
export const photoDetail = async (req, res) => {
  const {
    params: { id },
    user,
  } = req;
  try {
    const photo = await Photo.findById(id)
      .populate("creator")
      .populate("comments");
    res.render("photoDetail", {
      pageTitle: `${photo.creator.name}: ${photo.description}`,
      photo,
      user,
    });
  } catch (error) {
    console.log(error);
    res.redirect(routes.home);
  }
};

export const postAddComment = async (req, res) => {
  const {
    params: { id },
    body: { comment },
    user,
  } = req;

  let commentId;
  try {
    const photo = await Photo.findById(id);
    const newComment = await Comment.create({
      text: comment,
      creatorId: user.id,
      creatorName: user.name,
      creatorAvatar: user.avatarUrl,
    });
    // eslint-disable-next-line no-underscore-dangle
    commentId = await newComment._id;
    photo.comments.push(commentId);
    res.json(commentId);
    console.log(`comment: ${comment}, commentId: ${commentId}`);
    photo.save();
  } catch (error) {
    res.status(400);
  } finally {
    res.end();
  }
};
export const postEditComment = async (req, res) => {
  const {
    params: { id },
    body: { editedComment },
  } = req;
  try {
    await Comment.findOneAndUpdate({ _id: id }, { text: editedComment });
  } catch (error) {
    res.status(400);
  } finally {
    res.end();
  }
};
export const postDeleteComment = async (req, res) => {
  const {
    body: { commentId, photoId },
